import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { add } from '../slices/productSlice';



export const SetData = ({
    payload,
}) => {
    const dispatch = useDispatch();
    dispatch(add(payload))
    return(
        null
    );
};

export default SetData;
